// Navbar.js
import React from 'react';
import { ChakraProvider, CSSReset, Box, Flex, Link, Spacer, Image } from '@chakra-ui/react';

const Navbar = () => {
  return (
    <ChakraProvider>
      <CSSReset />
      <Box bg="#00324B"  w='100%' h= "100px" display="flex">
        <Flex align="center" justify="between">
        
          <Image src='/img/TPRGogoIcon.png'alt="Logo" boxSize="80px" objectFit="contain" mr={4} />
          </Flex>
          <Flex align="center" justify="center">
          <Spacer />
          <Link href="#" color="white" mr={4}>
            Home
          </Link>
          <Link href="#" color="white" mr={4}>
            About
          </Link>
          <Link href="#" color="white" mr={4}>
            Services
          </Link>
          <Link href="#" color="white">
            Contact
          </Link>
        </Flex>
      </Box>
    </ChakraProvider>
  );
};

export default Navbar;
